// Note: parameters will be updated soon to be more compatible with zCash's implementation

struct BabyJubJubParams {
	// field JUBJUBE
	field JUBJUBC
	field JUBJUBA
	field JUBJUBD
	field MONTA
	field MONTB
	field[2] INFINITY
	field Gu
	field Gv
